
CREATE EXTENSION IF NOT EXISTS "uuid-ossp";

DROP TABLE IF EXISTS "FinesHistory";
DROP SEQUENCE IF EXISTS "FinesHistory_id_seq";
CREATE SEQUENCE "FinesHistory_id_seq" INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1;

CREATE TABLE "public"."FinesHistory" (
    "id" bigint DEFAULT nextval('"FinesHistory_id_seq"') NOT NULL,
    "userId" character varying NOT NULL,
    "fineId" uuid NOT NULL,
    "isPaid" boolean DEFAULT false NOT NULL,
    "createdAt" timestamp DEFAULT now() NOT NULL,
    "reason" character varying NOT NULL,
    "finesImport" double precision DEFAULT 1 NOT NULL,
    CONSTRAINT "PK_139dcc3c7607712f45a3a302c83" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "Polices";
CREATE TABLE "public"."Polices" (
    "identification" uuid DEFAULT uuid_generate_v4() NOT NULL,
    "name" character varying NOT NULL,
    "lastname1" character varying NOT NULL,
    "lastname2" character varying NOT NULL,
    "dni" character varying NOT NULL,
    "isDeleted" boolean DEFAULT false NOT NULL,
    "password" character varying NOT NULL,
    "username" character varying NOT NULL,
    "email" character varying NOT NULL,
    CONSTRAINT "PK_95b37087f20c16dbe69d22fdec1" PRIMARY KEY ("identification")
) WITH (oids = false);

DROP TABLE IF EXISTS "Users";
CREATE TABLE "public"."Users" (
    "id" uuid DEFAULT uuid_generate_v4() NOT NULL,
    "name" character varying NOT NULL,
    "lastname1" character varying NOT NULL,
    "lastname2" character varying NOT NULL,
    "dni" character varying NOT NULL,
    "direction" character varying NOT NULL,
    "zipcode" character varying NOT NULL,
    "town" character varying NOT NULL,
    "hasFines" boolean DEFAULT false NOT NULL,
    "username" character varying(255) NOT NULL,
    "password" character varying(255) NOT NULL,
    "email" character varying(255) NOT NULL,
    "created_at" timestamp DEFAULT now() NOT NULL,
    "updated_at" timestamp DEFAULT now() NOT NULL,
    "is_deleted" boolean DEFAULT false NOT NULL,
    CONSTRAINT "PK_16d4f7d636df336db11d87413e3" PRIMARY KEY ("id"),
    CONSTRAINT "UQ_3c3ab3f49a87e6ddb607f3c4945" UNIQUE ("email"),
    CONSTRAINT "UQ_d9de24daa15c9441939de28998e" UNIQUE ("dni"),
    CONSTRAINT "UQ_ffc81a3b97dcbf8e320d5106c0d" UNIQUE ("username")
) WITH (oids = false);

DROP TABLE IF EXISTS "user_roles";
DROP SEQUENCE IF EXISTS user_roles_id_seq;
CREATE SEQUENCE user_roles_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1;

CREATE TABLE "public"."user_roles" (
    "id" integer DEFAULT nextval('user_roles_id_seq') NOT NULL,
    "role" character varying(50) DEFAULT 'USER' NOT NULL,
    "user_id" uuid,
    "police_id" uuid,
    CONSTRAINT "PK_8acd5cf26ebd158416f477de799" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "vehicles";
CREATE TABLE "public"."vehicles" (
    "id" uuid DEFAULT uuid_generate_v4() NOT NULL,
    "linces_plate" character varying NOT NULL,
    "chassis" character varying NOT NULL,
    "mark" character varying NOT NULL,
    "model" character varying NOT NULL,
    "year" integer NOT NULL,
    "colour" character varying NOT NULL,
    "type_Vehicle" character varying NOT NULL,
    "registration_document" boolean DEFAULT false NOT NULL,
    "insurance" boolean DEFAULT false NOT NULL,
    "insurance_lastDate" timestamp DEFAULT now() NOT NULL,
    "ownerChangeDate" timestamp DEFAULT now(),
    "ownerChange" boolean DEFAULT false,
    "purchase_Date" timestamp DEFAULT now() NOT NULL,
    "active" boolean DEFAULT true,
    "user_id" uuid,
    CONSTRAINT "PK_18d8646b59304dce4af3a9e35b6" PRIMARY KEY ("id"),
    CONSTRAINT "UQ_7c6681b16862bd33fcf11984445" UNIQUE ("chassis")
) WITH (oids = false);

ALTER TABLE ONLY "public"."user_roles" ADD CONSTRAINT "FK_87b8888186ca9769c960e926870" FOREIGN KEY (user_id) REFERENCES "Users"(id) NOT DEFERRABLE;
ALTER TABLE ONLY "public"."user_roles" ADD CONSTRAINT "FK_9e5794b653b82691778921dccf5" FOREIGN KEY (police_id) REFERENCES "Polices"(identification) NOT DEFERRABLE;

ALTER TABLE ONLY "public"."vehicles" ADD CONSTRAINT "FK_88b36924d769e4df751bcfbf249" FOREIGN KEY (user_id) REFERENCES "Users"(id) NOT DEFERRABLE;






